import "./App.css";
import {
  GoogleMapsProvider,
  useGoogleMap,
} from "@ubilabs/google-maps-react-hooks";
import { useState } from "react";

const mapOptions = {
  zoom: 10,
  center: {
    lat: 43.68,
    lng: -79.43,
  },
};

export default function App() {
  const [mapContainer, setMapContainer] = useState(null);

  return (
    <div>
      <GoogleMapsProvider
        googleMapsAPIKey="AIzaSyD_uy502Rcw9ljm2QquhymBPjqHoA4LOM4"
        options={mapOptions}
        mapContainer={mapContainer}
      >
        <div
          ref={(node) => setMapContainer(node)}
          style={{ height: "100vh" }}
        />
      </GoogleMapsProvider>
    </div>
  );
}
